import React from 'react';
import '../../normalize.scss';
import '../../base.scss';
import CodigoConfirmacao from '../../components/RecuperaSenha/CodigoConfirmacao';
import View from "../view/view"

const CodigoConfirm = () => (
  <React.Fragment>
      <View public={true}>
          <CodigoConfirmacao/>
      </View>
    </React.Fragment>
); 

export default CodigoConfirm;
